import React from 'react';

const Footer = ({comments, shares, likes, emailLink}) => {
	return (
		<div>
			<div><img alt='' src='like.svg'/>{likes}</div>
			<div><img alt='' src='comments.svg'/>{comments}</div>
			<div><img alt='' src='share.svg'/>{shares}</div>
			<div><img alt='' src='envelope.svg'/></div>
		</div>
		)
}

export default Footer;
